            "peopleApplicableInfo": {
                "resourceDesc": "20周岁（含）-50周岁（含）",
                "serialNumber": 1,
                "rangeMax": 50,
                "rangeMin": 20
            }
        }],
        "minQuantity": 1,
        "adequateInventory": true,
        "abtest": [{
            "tsource": "200518_VAC_fill",
            "tresult": "A"
        }, {
            "tsource": "200818_VAC_paixu",
            "tresult": "A"
        }],
        "canSaleChannels": [2, 5, 7, 21, 11, 12, 17, 20, 27, 13, 14, 15, 18, 9, 16],
        "canViewChannels": [2, 5, 7, 21, 11, 12, 17, 20, 27, 13, 14, 15, 18, 9, 16]
    }
    const transform = (originalData) => {
        console.log('samePackageNameArray')

        const {
            packageInfos,
            priceAndStockInfos
        } = originalData;
        const packageIdMap = {};
        const hasProductIdArray = [];
        //这一步得到了哪些是有productid的
        packageInfos.forEach((item, index) => {
            if (item.productId) hasProductIdArray.push(index)
        }); //[0,1,2,3]
        //这一步需要
        hasProductIdArray.forEach((hasProductIdIndex) => {
            const packageName = packageInfos[hasProductIdIndex].packageName;
            const packageId = packageInfos[hasProductIdIndex].packageId;

            const productId = packageInfos[hasProductIdIndex].productId;
            packageInfos.forEach((item, index) => {
                if (item.packageName === packageName && productId !== item.productId) {
                    //samePackageNameArray.push(index);
                    //取带productid的resourceInfos  
                    let originalResourceInfos = packageInfos[hasProductIdIndex].resourceInfos;
                    originalResourceInfos = originalResourceInfos.map((item) => {
                        return {
                            ...item,
                            productId,
                            packageId
                        };
                    });

                    //插入到item.resourceInfos中
                    if (!item.resourceInfos) item.resourceInfos = [];
                    item.resourceInfos = [...item.resourceInfos, ...originalResourceInfos];
                    //取映射
                    if (!packageIdMap[item.packageId]) packageIdMap[item.packageId] = [];
                    packageIdMap[item.packageId].push(packageInfos[hasProductIdIndex].packageId);
                }
            });
        })
        //删除之前需要合并的项
        let count = 0;
        hasProductIdArray.forEach((item) => {
            packageInfos.splice(item + count, 1);
            count--;
        });
        originalData.packageInfos = packageInfos;
        //priceAndStockInfos操作

        const keys = Object.keys(packageIdMap);
        priceAndStockInfos.forEach(element => {
            const shouldDeleteArray = new Set();
            element.packagePriceAndStockInfos.forEach((targetItem, index) => {
                if (keys.includes(targetItem.packageId.toString())) {
                    const reflectPackageIdArray = packageIdMap[targetItem.packageId];
                    element.packagePriceAndStockInfos.forEach((currentItem, index) => {
                        if (reflectPackageIdArray.includes(currentItem.packageId)) {
                            shouldDeleteArray.add(index);
                            targetItem.resourcePriceAndStockInfos = [...targetItem
                                .resourcePriceAndStockInfos, ...currentItem
                                .resourcePriceAndStockInfos
                            ];
                        }
                    })
                }

            });
            let count = 0;
            [...shouldDeleteArray].sort().forEach((item) => {
                element.packagePriceAndStockInfos.splice(item + count, 1);
                count--;
            });
        });
        originalData.packageInfos = packageInfos;
        originalData.priceAndStockInfos = priceAndStockInfos;
        return originalData;

    }
    const time = Date.now();
    console.log(transform(originalData))

    alert(Date.now() - time);
</script>
